INSERT INTO Sugestoes VALUES(4,'Leonel Costa', 'leonelcosta24@hotmail.com', 'Cuidados com o cão que adotei', 'Boa Tarde, o cão que adotei na passada terça-feira encontra-se desde então a vomitar. Ele encontrava-se sobre algum cuidado especial?', 'Lida', '2019/12/05','Enviada');
